css:
@-moz-document url-prefix("http://putlocker"), url-prefix("https://putlocker") {
/* latin-ext */
@font-face {
  font-family: 'Lato';
  font-style: normal;
  font-weight: 400;
  src: local('Lato Regular'), local('Lato-Regular'), url(https://fonts.gstatic.com/s/lato/v11/8qcEw_nrk_5HEcCpYdJu8BTbgVql8nDJpwnrE27mub0.woff2) format('woff2');
  unicode-range: U+0100-024F, U+1E00-1EFF, U+20A0-20AB, U+20AD-20CF, U+2C60-2C7F, U+A720-A7FF;
}
/* latin */
@font-face {
  font-family: 'Lato';
  font-style: normal;
  font-weight: 400;
  src: local('Lato Regular'), local('Lato-Regular'), url(https://fonts.gstatic.com/s/lato/v11/MDadn8DQ_3oT6kvnUq_2r_esZW2xOQ-xsNqO47m55DA.woff2) format('woff2');
  unicode-range: U+0000-00FF, U+0131, U+0152-0153, U+02C6, U+02DA, U+02DC, U+2000-206F, U+2074, U+20AC, U+2212, U+2215, U+E0FF, U+EFFD, U+F000;
}
* {
    font-family: 'Lato', sans-serif;
}
a:active, a:link, a:visited {
    color: #70D9E0;
}
body {
    background-position: center;
    background-size: cover;
    background-repeat: no-repeat;
    background-image: url('http://mnsweet.com/userstyles/bg-9-full.jpg');
}
body>table:nth-child(2)>tbody>tr>td:nth-child(2),
body>table:nth-child(3)>tbody>tr>td:nth-child(2) {
    display: none;
}
td.mainlogo {
    background-color: transparent;
    border: 0;
    padding: 0;
}
td.mainlogo a {
    height: 97px;
    display: inline-block;
    background-image: url('data:image/png;base64,');
}
td.mainlogo img {
    display: inline;
    vertical-align: middle;
    border: 0 !important;
    visibility: hidden;
}
#search {
    float: right;
    margin: 30px 0 0;
    position: inherit;
    width: inherit;
}
#search input[type="text"] {
    border: 0 !important;
    height: 16px !important;
    width: 266px !important;
    font-size: 11px !important;
    padding: 10px !important;
    color: #ffffff !important;
    background-color: rgba(0, 0, 0, 0.2) !important;
}
#search input[type="submit"] {
    border: 0 !important;
    height: 36px !important;
    width: 90px !important;
    font-size: 12px !important;
    padding: 10px !important;
    background-color: rgba(0, 0, 0, .6) !important;
    color: #FFFFFF !important;
    display: inline-block !important;
    line-height: 8px !important;
    margin: 0 0 0 -4px !important;
}
#nav {
    box-sizing: border-box;
    padding: 0;
    background: none;
    width: 920px;
}
#nav li:hover>a {
    background: rgba(0, 0, 0, 0.6);
    color: #FFFFFF;
}
#nav .dropdown,
#nav .dropdown2 {
    position: absolute;
    z-index: 999;
    top: 33px;
    left: 0;
    background-color: rgba(0, 0, 0, 0.9);
    border: #000000 solid 1px;
}
#nav .dropdown {
    width:330px;
}
#nav .dropdown ul li,
#nav .dropdown2 ul li {
    text-align: center !important;
    background: none !important;
    padding:0 !important;
}
#nav .dropdown2 .col1 {
    margin: 0;
}
#nav>li a {
    padding: 0 17px !important;
    color:#FFFFFF !important;
}
#nav>li a:hover {
    background: #FFFFFF !important;
    color:#000000 !important;
}
#nav .dropdown .col1,
#nav .dropdown .col1+.col1+.col1{
    margin: 0;
    width:110px;
}
.content-box {
    width: 920px;
    background-color: rgba(0, 0, 0, .4);
    border: 0;
	text-align:center;
}
.content-box * {
    color: #FFFFFF;
}
.submit_form_textfield {
    color: #021C27 !important;
}
.content-box h1 {
    background-color: rgba(0, 0, 0, .4);
    border: 0;
}
.content-box h1 strong font {
    color: #ffffff
}
.content-box h2 {
    border: 0 !important;
    border-top: 1px solid #000000 !important;
    border-bottom: 0 !important;
    padding: 5px !important;
    background-color: rgba(255, 255, 255, .1) !important;
    color: #ffffff !important;
    text-align: center !important;
}
.content-box h2 a {
    color: #ffffff !important;
    text-decoration:underline;
}
.content-box table tr td {
    border: 0 !important;
    background-color: transparent !important;
}
.content-box table {
	margin:auto;
}
.content-box>div {
    background: #000 !important;
    border-bottom: 0 !important;
}
td.entry {
	text-align:left !important;
}
.content-box>div.message {
    text-align: center;
    background: #BD3D5E !important;
	padding: 5px 10px;
    margin: 10px 0 0;
}
img {
    padding: 2px !important;
    border: 1px solid #000000 !important;
}
.table {
    margin-top: 10px;
}
.table td {
    text-align: center;
}
.table td div {
    width: 100% !important;
}
.table td a {
    display: inline-block;
    color: #FFFFFF;
}
.table td a img {
    -webkit-transition: -webkit-transform 1.3s, border 0.5s ease;
    transition: transform 1.3s, border 0.5s ease;
}
.table td a:hover img {
    border-color: #FFFFFF !important;
    -webkit-transition: -webkit-transform 1.3s, border 0.5s ease;
    transition: transform 1.3s, border 0.5s ease;
}
.table td a:hover {
    color: #DDDDDD;
}
.content {
    text-align: center;
    font-family: 'Lato', sans-serif;
    font-size: 14px;
    margin: 0;
    padding: 10px;
    color: #FFFFFF;
}
form,
.form_info{
    color: #FFFFFF;
}
form>table>tbody>tr>td:nth-child(1) {
	width:30%;
	text-align:right;
}
form>table>tbody>tr>td:nth-child(2) {
	width:70%;
	text-align:left;
}
.submit_form_textfield {
	width:90%;
}
.addthis_toolbox.addthis_default_style {
	display:inline-block;
    background-color: rgba(0,0,0,0) !important;
}
.fb-comments.fb_iframe_widget {
    background-color: rgba(255,255,255,.5) !important;
}
}
